import React from "react";
import { Routes, Route } from "react-router";
import { Content } from "./pages/Home";

const Pages = () => {
    return (
        <div>
            <Routes>
                <Route path="/" element={<Content />} />
            </Routes>
        </div>
    )
}

export default Pages;
